document.addEventListener('DOMContentLoaded', () => {
  const canvas = document.getElementById('versionsChart');
  const ctx = canvas.getContext('2d');
  const gradient = ctx.createLinearGradient(0, 0, 0, 400);

  gradient.addColorStop(0, 'rgba(75,192,192,0.3)');
  gradient.addColorStop(1, 'rgba(75,192,192,0.05)');

  // eslint-disable-next-line no-unused-vars
  const versionsChart = new Chart(canvas, {
    type: 'line',
    data: {
      datasets: [{
        label: 'Total versions',
        data: dataVersions.map(d => ({
          x: new Date(d.date),
          y: d.versions,
          repoVersions: d.repoVersions,
        })),
        borderColor: 'rgb(75, 192, 192)',
        backgroundColor: 'rgba(75, 192, 192, 0.1)',
        borderWidth: 2,
        pointRadius: 3,
        pointBackgroundColor: 'rgb(75, 192, 192)',
        pointBorderColor: '#fff',
        pointHoverRadius: 5,
        fill: true,
        tension: 0.4,
      }],
    },
    options: {
      responsive: true,
      layout: { padding: { right: 40 } },
      plugins: {
        legend: {
          display: false,
          labels: {
            font: { size: 16, family: 'system-ui, -apple-system, sans-serif' },
            color: '#333',
          },
        },
        annotation: {
          annotations: {
            latestValue: {
              type: 'label',
              xValue: dataVersions[dataVersions.length - 1].date,
              yValue: dataVersions[dataVersions.length - 1].versions,
              content: dataVersions[dataVersions.length - 1].versions.toString(),
              backgroundColor: 'rgb(75, 192, 192)',
              color: 'white',
              font: { size: 14, weight: 'bold' },
              padding: 6,
              borderRadius: 4,
              yAdjust: -20,
              clip: false,
            },
          },
        },
        tooltip: {
          mode: 'index',
          intersect: false,
          displayColors: false,
          callbacks: {
            title(context) {
              const date = new Date(context[0].raw.x);

              return date.toLocaleDateString(undefined, { month: 'long', year: 'numeric' }); // use user's locale, see https://stackoverflow.com/a/31873738
            },
            label(context) {
              return `${context.raw.y} changements enregistrés`;
            },
          },
        },
      },
      scales: {
        x: {
          type: 'time',
          max: new Date(new Date(dataVersions[dataVersions.length - 1].date).setMonth(new Date(dataVersions[dataVersions.length - 1].date).getMonth() + 4)),
          time: {
            unit: 'year',
            displayFormats: { month: 'yyyy' },
          },
          title: {
            display: false,
            text: 'Month',
            font: { size: 18, family: 'system-ui, -apple-system, sans-serif' },
            color: '#333',
          },
          grid: { color: 'rgba(0, 0, 0, 0.1)' },
        },
        y: {
          beginAtZero: true,
          title: {
            display: false,
            text: 'Total number of versions',
            font: { size: 18, family: 'system-ui, -apple-system, sans-serif' },
            color: '#333',
          },
          grid: { color: 'rgba(0, 0, 0, 0.1)' },
        },
      },
    },
  });
});
